B.zh=new A.jg("Mirante Tecnologia \xb7 Tempo integral | Desenvolvedor Flutter S\xeanior","Nesse trabalho eu fui alocado na Cooperativa central Ailos. Trabalhei no setor de engenharia do aplicativo Ailos+, aplicativo principal da empresa que \xe9 uma cooperativa de cr\xe9dito.\n-Fui respons\xe1vel por moldar a arquitetura, gerenciamento de estado e regras do projeto.\n-Atuei com Design system\n-Code review\n-Suporte aos demais times\n-Onboarding de novos desenvolvedores\n-Treinamento de novos desenvolvedores\n-Documenta\xe7\xe3o dos padr\xf5es do projeto e regras usadas em: Testes unit\xe1rios, arquitetura, constru\xe7\xe3o de telas, melhores pr\xe1ticas de desenvolvimento, t\xe9cnicas de aprimoramento de performance, consumo de APIs, melhores pr\xe1ticas para se usar no gerenciador de estado (Cubit).\n-Atuei em pocs de modulariza\xe7\xe3o e arquitetura baseada em packages.\n-Tamb\xe9m fui respons\xe1vel para introdu\xe7\xe3o da automa\xe7\xe3o de tarefas via eventbus e o in\xedcio da Server driven ui bem como remote themes.\nOs principais desafios enfrentados no projeto foram relacionados a seguran\xe7a pois por se tratar de um app banc\xe1rio a principal preocupa\xe7\xe3o foi com a seguran\xe7a da aplica\xe7\xe3o. O projeto conta com, pix, cota capital, empr\xe9stimos, onboarding, cart\xf5es, investimentos, recarga de celulares, limites de cr\xe9dito, d\xe9bito direto, autentica\xe7\xe3o via cpf e senha, autentica\xe7\xe3o via biometria, registro de clientes via SMS e email, controle de dispositivo via MFA, controle de segura\xe7a e logs via Dynatrace, firebase analytics para tracking e mapa de calor, remote config para armazenamento de chaves entre outros.","2 anos e 3 meses",null)
B.zi=new A.jg("Design L\xedquido \xb7 Tempo integral | Desenvolvedor Flutter | Java | Spring","Desenvolvia aplica\xe7\xf5es de acordo com as exig\xeancias da empresa, focado nas boas pr\xe1ticas de programa\xe7\xe3o e nas funcionalidades limpas e objetivas impostas pelos clientes.\n-Atuei no backend das aplica\xe7\xf5es bem como na sua frente mobile.\n-Fui respons\xe1vel pelo desenvolvimento do aplicativo Influenster e da plataforma de ensino Polimata (Front em Flutter e back em Spring).\n-Como Desenvolvedor Flutter | Java | Spring, fui respons\xe1vel pelo desenvolvimento e manuten\xe7\xe3o de aplicativos m\xf3veis e APIs RESTful para diversos projetos da empresa.\n-Minhas principais responsabilidades inclu\xedam:\n-Desenvolvimento de aplicativos m\xf3veis nativos e multiplataforma utilizando o framework Flutter, proporcionando uma experi\xeancia de usu\xe1rio excepcional em dispositivos Android e iOS.\n-Projetar, desenvolver e manter APIs RESTful escal\xe1veis e eficientes usando Java e Spring Framework, garantindo a interoperabilidade entre o frontend e o backend.\n-Colabora\xe7\xe3o com equipes multidisciplinares para entender os requisitos do projeto e propor solu\xe7\xf5es t\xe9cnicas adequadas, garantindo a entrega dentro do prazo e do or\xe7amento.\n-Realiza\xe7\xe3o de testes unit\xe1rios, testes de integra\xe7\xe3o e testes de aceita\xe7\xe3o automatizados para garantir a qualidade e a estabilidade do software.\n-An\xe1lise de sistemas e identifica\xe7\xe3o de oportunidades de melhoria cont\xednua para otimizar o desempenho e a escalabilidade dos aplicativos.\n-Fornecimento de suporte t\xe9cnico e resolu\xe7\xe3o de problemas em aplicativos existentes, garantindo sua funcionalidade e desempenho.\n-Durante minha atua\xe7\xe3o nesse cargo, pude aprimorar minhas habilidades em desenvolvimento de aplicativos m\xf3veis, programa\xe7\xe3o Java e desenvolvimento de APIs RESTful com Spring. Al\xe9m disso, adquiri experi\xeancia em trabalhar em equipe, resolver problemas complexos e entregar solu\xe7\xf5es de alta qualidade que atendiam \xe0s necessidades dos clientes e usu\xe1rios finais.","7 meses",null)
B.zj=new A.jg("Slicesoft \xb7 Tempo integral | Desenvolvedor Java | Spring S\xeanior","Como Desenvolvedor S\xeanior Java Spring, pude liderar e contribuir significativamente para projetos complexos de desenvolvimento de software. Minhas responsabilidades neste papel inclu\xedram:\n-Lideran\xe7a t\xe9cnica na concep\xe7\xe3o, arquitetura e implementa\xe7\xe3o de sistemas de software escal\xe1veis e de alta qualidade usando o Spring Framework.\n-Colabora\xe7\xe3o com equipes multifuncionais para traduzir requisitos de neg\xf3cios em solu\xe7\xf5es t\xe9cnicas eficazes, mantendo um alto padr\xe3o de qualidade de c\xf3digo e design.\n-Implementa\xe7\xe3o de padr\xf5es de design e melhores pr\xe1ticas de desenvolvimento, como Clean Architecture, TDD, Design Patterns e SOLID principles.\n-Desenvolvimento de APIs RESTful e microservices robustos e eficientes usando Spring Boot, Spring MVC ou Spring WebFlux.\n-Integra\xe7\xe3o cont\xednua e implanta\xe7\xe3o automatizada de sistemas usando ferramentas como Jenkins, GitLab CI/CD, Docker e Kubernetes.\n-Implementa\xe7\xe3o de seguran\xe7a de aplicativos, incluindo autentica\xe7\xe3o, autoriza\xe7\xe3o, prote\xe7\xe3o contra ataques de seguran\xe7a e conformidade com padr\xf5es de seguran\xe7a.\n-Otimiza\xe7\xe3o de desempenho de aplicativos, identificando gargalos de desempenho e aplicando t\xe9cnicas de melhoria de desempenho.\n-Mentoria e orienta\xe7\xe3o de membros juniores da equipe, compartilhando conhecimento e melhores pr\xe1ticas de desenvolvimento de software.\nFui capaz de enfrentar desafios complexos e entregar solu\xe7\xf5es de alta qualidade que atendam \xe0s necessidades do neg\xf3cio. Estou constantemente buscando oportunidades para aprender e crescer profissionalmente, enquanto contribuo para o sucesso de projetos desafiadores.","1 m\xeas",null)
B.zk=new A.jg("UzzyTech consultoria \xb7 Tempo integral | Desenvolvedor Flutter | Java | Spring","-Desenvolvia telas para aplicativos\n-Implementava l\xf3gica em apps j\xe1 existentes, bem como atualizando apps para as vers\xf5es mais novas do flutter que usam nullsafety.\n-Fazer aplica\xe7\xf5es do zero inclusive sua API em Java quando solicitado. Infelizmente a empresa fechou suas portas devido a problemas internos.\n-Durante o per\xedodo que passei na empresa desenvolvi os aplicativos Bring! Labs AG, Recipe Keeper e 4 Farm Agricultura de Precis\xe3o, bem como seus backends em Spring.\n-Como Desenvolvedor Flutter | Java | Spring, desempenhei um papel fundamental no desenvolvimento e na evolu\xe7\xe3o de aplicativos m\xf3veis e sistemas de backend para diversos projetos da empresa. Minhas responsabilidades inclu\xedam:\n-Utiliza\xe7\xe3o do framework Flutter para criar aplicativos m\xf3veis modernos e responsivos, garantindo uma experi\xeancia de usu\xe1rio intuitiva e de alta qualidade em dispositivos Android e iOS.\n-Desenvolvimento de APIs RESTful robustas e escal\xe1veis utilizando Java e Spring Framework, com foco na seguran\xe7a, desempenho e modularidade do c\xf3digo.\n-Colabora\xe7\xe3o com equipes de design e produto para traduzir requisitos de neg\xf3cios em funcionalidades t\xe9cnicas, contribuindo para a defini\xe7\xe3o de arquiteturas de software eficientes.\n-Implementa\xe7\xe3o de pr\xe1ticas de DevOps para automatizar processos de integra\xe7\xe3o cont\xednua, entrega cont\xednua e implanta\xe7\xe3o cont\xednua, garantindo uma entrega r\xe1pida e confi\xe1vel de novos recursos.\n-Realiza\xe7\xe3o de testes automatizados e manuais para validar a funcionalidade e a usabilidade dos aplicativos, identificando e corrigindo bugs e problemas de desempenho.\n-Participa\xe7\xe3o ativa em reuni\xf5es de revis\xe3o de c\xf3digo, sess\xf5es de brainstorming e outras atividades colaborativas para promover a inova\xe7\xe3o e o aprimoramento cont\xednuo dos produtos.\n-Durante minha atua\xe7\xe3o nesse cargo, desenvolvi habilidades s\xf3lidas em desenvolvimento de aplicativos m\xf3veis e backend, al\xe9m de aprimorar minhas habilidades em trabalho em equipe, comunica\xe7\xe3o eficaz e resolu\xe7\xe3o de problemas.","2 anos e 4 meses",null)
B.zl=new A.jg("Nexus \xb7 Tempo integral | Desenvolvedor Android | Java | Spring","Constru\xe7\xe3o de aplicativos pr\xf3prios para android. Inicialmente apenas nativo, m\xe1s em 2019 passei a construir os aplicativos com Flutter, ambos com backend feito em Java + Spring.\n-Aqui foram desenvolvidos aplica\xe7\xf5es para o android 5.0 apps como: Ferreira Costa, Mobly, Facctio, Scannium, Posthaus, Vallia, AmaroEx e etc.\n-Como Desenvolvedor Java Android | Spring em meu primeiro emprego, tive a oportunidade de aprender e contribuir para o desenvolvimento de aplicativos m\xf3veis e sistemas web usando tecnologias Java e Spring Framework. Minhas responsabilidades inclu\xedam:\n-Desenvolvimento de aplicativos Android nativos utilizando Java, garantindo uma experi\xeancia de usu\xe1rio intuitiva e funcionalidades robustas.\n-Colabora\xe7\xe3o com a equipe de desenvolvimento para projetar e implementar APIs RESTful eficientes utilizando Spring Framework, com foco em escalabilidade e modularidade do c\xf3digo.\n-Participa\xe7\xe3o em todas as fases do ciclo de vida do desenvolvimento de software, desde a an\xe1lise de requisitos at\xe9 a implanta\xe7\xe3o e manuten\xe7\xe3o dos sistemas em produ\xe7\xe3o.\n-Teste e depura\xe7\xe3o de aplicativos para garantir a qualidade e a estabilidade do software, identificando e corrigindo bugs e problemas de desempenho.\n-Aprendizado cont\xednuo e busca ativa por conhecimento em novas tecnologias e melhores pr\xe1ticas de desenvolvimento de software.\n-Durante minha experi\xeancia neste cargo, desenvolvi habilidades fundamentais em programa\xe7\xe3o Java e desenvolvimento de aplicativos Android, al\xe9m de adquirir uma compreens\xe3o s\xf3lida dos princ\xedpios de desenvolvimento web com Spring Framework.","5 anos e 5 meses",null)
